HALIAX_BLACK_CONFIG = ROOT_DIR / "lib/haliax/pyproject.toml"

EXCLUDE_PATTERNS = [
    ".git/**",
    ".github/**",
    "tests/snapshots/**",
    # grpc generated files
    "**/*_connect.py",
    "**/*_pb2.py",
    "**/*.gz",
